import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";
import reportWebVitals from "./reportWebVitals";
import NamePerson from "./NamePerson.js/index.js";
import PersonDetails from "./PersonDetails";
import PeopleList from "./PeopleList";
import PeopleTable from "./PeopleTable.js";
import FirstTeenager from "./FirstTeenager.js/index.js";
import AreAllTeenagers from "./AreAllTeenagers";
import SortByOccupationAndAge from "./SortByOccupationAndAge";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
    <NamePerson />
    <PersonDetails />
    <PeopleList />
    <PeopleTable />
    <FirstTeenager />
    <AreAllTeenagers />
    <SortByOccupationAndAge />
  </React.StrictMode>
);

reportWebVitals();
